// import Navbar from '../components/Navbar';
import Link from 'next/link';
import { Navbar, IconBentcare as Icon } from '@bentcare/core';
import GlobalStyle from '../styles/global';
import logo from '../assets/logo.jpg';

const MyApp: React.FC = ({ Component, pageProps }: any) => {
  return (
    <>
      <Link href="/">
        <Navbar
          backgroundColor="#ffffff"
          brand={logo}
          brandAlt="Bentcare"
          justifyContent="space-between"
          listMenu={[
            {
              description: 'Item 01',
              link: '#',
            },
            {
              description: 'Item 02',
              link: '#',
            },
            {
              description: 'Item 03',
              link: '#',
            },
          ]}
          position="static"
        >
          <Icon icon="user" />
          <Icon icon="bag" />
        </Navbar>
      </Link>
      <Component {...pageProps} />
      <GlobalStyle />
    </>
  );
};

export default MyApp;
